  <script>
    function buscarAsegurado(){
      let asegurado = $("#buscarAsegurado").val();
      if (asegurado.length)
        location.replace("?view=siniestro/resultadosBusqueda&searchAsegurado=" + asegurado);
    }

    function buscarid() {
      let siniestro = $("#buscarID").val();
      if (siniestro.length)
      
        location.replace("?action=searchID&search=" + siniestro);
        // location.replace("?view=siniestro/ver&search=" + siniestro);
    }

    
    function buscarNS() {
      let siniestro = $("#buscarNS").val();
      if (siniestro.length)
        location.replace("?action=searchID&searchNS=" + siniestro);
    }

    function capitalize(word) {
      return word[0].toUpperCase() + word.slice(1).toLowerCase();
    }

    document.onreadystatechange = function(evento) {

      if (document.readyState === "complete") {

        IMask(
          document.getElementById('buscarID'), {
            mask: '000-000-00'
          });

        //---------------------------------------------------------------LOADER OFF
        // document.querySelector(".imgLog").style.opacity='0';
        // document.querySelector("[loader]").style.opacity='0';

        //  document.querySelector(".imgLog").classList.add='hideLoader';
        $(".imgLog").addClass("hideLoader");
        $("[loader]").addClass("hideLoader");
        // document.querySelector("[loader]").classList.add='hideLoader';
        setTimeout(() => {
          document.querySelector(".imgLog").style.display = 'none';
          document.querySelector("[loader]").style.display = 'none';
          document.querySelector("html").style.overflowY = 'scroll';
          document.querySelector("div.wrapper").style.display = 'block';
          document.querySelector("div.wrapper").style.opacity = '1';
        }, 250);

        $(function() {
          $('input[letter=capitalize]').keyup(function() {
            var a = this.value;
            x = a[a.length - 1];

            if (x == ' ') {
              exit();
            }

            if (this.value.length >= 1) {
              let ns = this.value.split(' ');
              txt = '';
              ns.forEach(ele => {
                // this.value = capitalize(this.value);
                if (ele.length == 1) {
                  let a1 = ele.toUpperCase();
                  txt = txt + ' ' + a1;
                } else
                if (ele.length >= 2) {
                  let a1 = ele[0].toUpperCase() + ele.slice(1).toLowerCase();
                  txt = txt + ' ' + a1;
                }
              });

              if (x == ' ') {
                this.value = txt + ' '
              } else {
                this.value = txt.trim();
              }
            }
            // this.value = this.value.toCapitalize.capitalize();
          });
        });

        //funcion para mantener online la sesion
        $(function() {
          setInterval(() => {

            $.ajax({
              url: '?action=actividadOn',
              method: "POST",
              data: {
                "data": 'activo',
                "params": 'online'
              },

              success: function(respuesta) {
                console.log("Session activa");
                console.log(respuesta);
              },
              error: {
                function(e) {
                  conjsole.log(e);
                }

              }
            }); //fin ajax

          }, 50000);

        })

      }



    };


