    function downloadAsExcel(paramsAjax, NombresList, formato) {
      Swal.fire({
        allowOutsideClick: false,
        icon: 'info',
        title: 'Descargando XLSX...',
        // text: 'Por favor intentalo nuevamente, si persiste el problema, contacte a asicomgraphics.mx',
        confirmButtonText: 'OK',
        // footer: 'Sentimos las molestias',
        didOpen: () => {
          Swal.showLoading()
        }
      });


      $.ajax({
        url: '?action=jtable/tablaSiniestrosExcel.ajax',
        method: "POST",
        data: {
          "downloadExcel": formato,
          "params": paramsAjax
        },

        success: function(respuesta) {
          const records = JSON.parse(respuesta).Records;
          Swal.hideLoading();
          // dataset = JSON.parse(respuesta);
          console.log("Descargando xsls");
          downloadExcel(records, NombresList);
        },
        error: {
          function(e) {
            conjsole.log(e);
          }

        }
      });

    }

    function downloadAsExcelBitacorasID(timerst) {
      Swal.fire({
        allowOutsideClick: false,
        icon: 'info',
        title: 'Descargando Bitcoras en XLSX...',
        // text: 'Por favor intentalo nuevamente, si persiste el problema, contacte a asicomgraphics.mx',
        confirmButtonText: 'OK',
        // footer: 'Sentimos las molestias',
        didOpen: () => {
          Swal.showLoading()
        }
