      $.ajax({
        url: '?action=jtable/tablaSiniestrosExcelBitacoras.ajax',
        method: "POST",
        data: {
          "timerst": timerst,
          "extras": 'none',
        },

        success: function(respuesta) {
          const records = JSON.parse(respuesta).Records;
          Swal.hideLoading();
          // dataset = JSON.parse(respuesta);
          console.log("Descargando xsls");
          downloadExcel(records, 'Bitcoras');
        },
        error: {
          function(e) {
            conjsole.log(e);
          }

        }
      });

    }
